class Solution {

    /**
     * @param Integer[] $batteryPercentages
     * @return Integer
     */
    function countTestedDevices($batteryPercentages) {
        $testedDevices = 0;
        $n = count($batteryPercentages);

        for ($i = 0; $i < $n; $i++) {
            if ($batteryPercentages[$i] > 0) {
                $testedDevices++;

                for ($j = $i + 1; $j < $n; $j++) {
                    $batteryPercentages[$j] = max(0, $batteryPercentages[$j] - 1);
                }
            }
        }

        return $testedDevices;
    }
}
